import React from "react";

import { 
    IonFooter, 
    IonGrid, 
    IonRow, 
    IonCol, 
    IonList, 
    IonItem,
    IonButton,
    IonIcon
} from '@ionic/react';

import '../assets/css/Custom.css';
import '../assets/css/Responsive.css';

const Footer: React.FC = () => {
    return (
        <IonFooter>
            <IonGrid>
                <IonRow>
                    <IonCol className="footer-top-col" size="12">
                        <IonList>
                            <IonItem><a href="#">Contact Us</a></IonItem>
                            <IonItem><a href="#">About</a></IonItem>
                            <IonItem><a href="#">Terms of Use</a></IonItem>
                        </IonList>
                        
                    </IonCol>

                    <IonCol className="footer-bottom-col" size="12">
                        <p className="ion-text-center"> All rights reserved.</p>
                    </IonCol>
                   
                </IonRow>

                <IonRow className="ion-hide-lg-down">
                    <IonCol className="footer-bottom-col" size="3">
                        <IonButton className="footer-notification-button" fill="clear">
                            <IonIcon slot="icon-only" src="/assets/images/bell-icon.svg" />
                        </IonButton>
                    </IonCol>
                </IonRow>

            </IonGrid>
        </IonFooter>
        
    );
};

export default Footer;
